{"cells":[{"source":"<a href=\"https://www.kaggle.com/johnakwei/realized-volatility-ln-rf-knn-garch-in-r?scriptVersionId=88418828\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"d619e479","metadata":{"papermill":{"duration":0.083366,"end_time":"2022-02-21T20:56:06.263838","exception":false,"start_time":"2022-02-21T20:56:06.180472","status":"completed"},"tags":[]},"source":["# Realized Volatility Linear Regression/Random Forest/K-Nearest Neighbor Prediction (in R)"]},{"cell_type":"markdown","id":"4f15b190","metadata":{"papermill":{"duration":0.084961,"end_time":"2022-02-21T20:56:06.428491","exception":false,"start_time":"2022-02-21T20:56:06.34353","status":"completed"},"tags":[]},"source":["### All Programming by John Akwei, ECMp ERMp Data Scientist  \n","### https://contextbase.github.io"]},{"cell_type":"markdown","id":"ee8cbefb","metadata":{"papermill":{"duration":0.071322,"end_time":"2022-02-21T20:56:06.572764","exception":false,"start_time":"2022-02-21T20:56:06.501442","status":"completed"},"tags":[]},"source":["# Section 1 - Synopsis"]},{"cell_type":"markdown","id":"a30d7707","metadata":{"papermill":{"duration":0.070826,"end_time":"2022-02-21T20:56:06.714879","exception":false,"start_time":"2022-02-21T20:56:06.644053","status":"completed"},"tags":[]},"source":["References:  \n","https://www.kaggle.com/kittlein/volatility  \n","https://www.kaggle.com/pehahn/introduction-to-financial-concepts-in-r\n","\n","As different stocks trade on different level on the market Optiver takes the ratio of best offer price and best bid price to calculate the bid-ask spread. The formula of bid/ask spread:\n","$$BidAskSpread=\\frac{BestOffer}{BestBid}−1$$\n","\n","## Weighted Averaged Price\n","\n","The formula of WAP can be written as below:\n","$$WAP = \\frac{(BidPrice1∗AskSize1+AskPrice1∗BidSize1)}{(BidSize1+AskSize1)}$$\n","\n","In this competition the target is constructed from the WAP.\n","\n","## Log Returns\n","\n","Comparing the price of a stock between yesterday and today is solved by computing the percentage change in price, also known as the stock return. In our example, the return for stock A was $$\\frac{$102  - $100}{$100} = 2\\% $$, while for stock B it was $$\\frac{$11 − $10}{$10} = 10\\% $$. The stock return coincides with the percentage change in our invested capital.\n","\n","Returns are widely used in finance, however log returns are preferred whenever some mathematical modelling is required. Calling St the price of the stock S at time t, we can define the log return between  t1  and  t2  as:\n","$$rt1,t2=log(\\frac{St2}{St1})$$\n","\n","Usually, we look at log returns over fixed time intervals, so with 10-minute log return we mean  $$rt=rt−10min,t$$.\n","Log returns present several advantages, for example: they are additive across time  $$rt1,t2+rt2,t3=rt1$$ regular returns cannot go below -100%, while log returns are not bounded\n","\n","## Realized Volatility\n","\n","When we trade options, a valuable input to our models is the standard deviation of the stock log returns. The standard deviation will be different for log returns computed over longer or shorter intervals, for this reason it is usually normalized to a 1-year period and the annualized standard deviation is called volatility.\n","\n","In this competition, you will be given 10 minutes of book data and we ask you to predict what the volatility will be in the following 10 minutes. Volatility will be measured as follows:\n","\n","We will compute the log returns over all consecutive book updates and we define the realized volatility,  σ , as the squared root of the sum of squared log returns.\n","\n","Where we use WAP as price of the stock to compute log returns. We want to keep definitions as simple and clear as possible, so that Kagglers without financial knowledge will not be penalized. So we are not annualizing the volatility and we are assuming that log returns have 0 mean.\n","\n","## Competition Data\n","\n","In this competition, Kagglers are challenged to generate a series of short-term signals from the book and trade data of a fixed 10-minute window to predict the realized volatility of the next 10-minute window. The target, which is given in train/test.csv, can be linked with the raw order book/trade data by the same time_id and stock_id. There is no overlap between the feature and target window.\n","\n","The submission file combines \"row_id\" from test.csv with predicted \"target\" (prediction from \"train.csv\")\n","\n","sample <- read.csv(\"../input/optiver-realized-volatility-prediction/sample_submission.csv\")\n","sample\n","row_id target\n","0-4    0.003048\n","0-32   0.003048\n","0-30   0.003048\n","\n","\"row_id\" from test.csv is a combination of stock_id and time_id connected by \"_\".\n","\n","test <- read_csv(\"../input/optiver-realized-volatility-prediction/test.csv\")\n","test\n","stock_id time_id row_id\n","0        4        0-4\n","0        32       0-32\n","0        34       0-34\n","\n","Therefore, predict \"target\" from train.csv by stock_id and time_id, then append prediction to test.csv row_id."]},{"cell_type":"markdown","id":"e2f5a413","metadata":{"papermill":{"duration":0.069726,"end_time":"2022-02-21T20:56:06.854389","exception":false,"start_time":"2022-02-21T20:56:06.784663","status":"completed"},"tags":[]},"source":["# Section 2 - Required Libraries"]},{"cell_type":"code","execution_count":1,"id":"edb3c462","metadata":{"execution":{"iopub.execute_input":"2022-02-21T20:56:06.997486Z","iopub.status.busy":"2022-02-21T20:56:06.994817Z","iopub.status.idle":"2022-02-21T20:56:10.49158Z","shell.execute_reply":"2022-02-21T20:56:10.490176Z"},"papermill":{"duration":3.566526,"end_time":"2022-02-21T20:56:10.491732","exception":false,"start_time":"2022-02-21T20:56:06.925206","status":"completed"},"tags"